These script commands are what you can use in scripts to convert between the RO classic job id, and eA's job system. The following script code demonstrates how to use these script commands to guess what your next job will be: set @eac, eaclass();
if (@eac&EAJL_2)
{	//2nd class //If upper or baby, you can't rebirth if (@eac&(EAJL_UPPER|EAJL_BABY)) { mes "You can't go anywhere, can you?"; close; } //Note that if we remove the EAJL_BABY check up there, the following //check will also fail, because there's no such thing as Rebirth-Baby //classes. set @newclass, roclass(@eac|EAJL_UPPER); if (@newclass == -1) { //Don't you hate this of SG and SL? mes "Haha, your class doesn't has a rebirth version yet!"; close; } mes "Still dreaming of the day you become a "+jobname(@newclass)+"?"; close;
}
set @class1, roclass(@eac|EAJL_2_1);
set @class2, roclass(@eac|EAJL_2_2);
if (@class1 == -1) { mes "Looks like you are stuck forever on that class."; close;
}
if (@class2 == -1) { //Not quite true, currently the only 1st class that doesn't has two //choices is Novice -> Supernovice (see s.novice section below) mes "Looks like you have no choice but to be a "+jobname(@class1)+"."; close;
}
mes "Have you decided yet if you want to be a "+jobname(@class1)+" or a "+jobname(@class2)+"?";
close;
